import React from 'react';
import logo from './logo.svg';
import './App.css';
import NavBar from './components/NavBar'
import PageTitle from './components/PageTitle'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>
          <NavBar ></NavBar>
        </div>
      </header>
      <div className="titleMain">
        <PageTitle></PageTitle>
      </div>

    </div>
  );
}

export default App;
